def bodyplot(data, organism='human_male', width=300, height=200, fill='#36175E', stroke='#0c2136'):
    """
    """
    if organism not in ('human_male', 'human_female'):
        return "Can not draw that organism. Please try one of ('human_male', 'human_female')"
    
    if organism == 'human_male':
        svg = f'<svg viewBox="0 0 {width} {height}" xmlns="http://www.w3.org/2000/svg">'
        for index, organ in enumerate(male_path_list):
            if organ['organ_name'] in data.keys() and data[organ['organ_name']] > 0:
                svg += f"""<path key="{index}" pointerEvents="all" className="{organ['organ_name']}" d="{organ['coordinates']}" transform="{organ['transformation']}" fill="{fill}" opacity="{data[organ['organ_name']]}" stroke-width="0.1" stroke="{stroke}">
                <title>{organ['organ_name'].replace('_', ' ').capitalize()}: {round(data[organ['organ_name']], 3)}</title>
                        </path>"""
            else:
                svg += f""" <path key="{index}" className="{organ['organ_name']}" d="{organ['coordinates']}" transform="{organ['transformation']}" fill="None" opacity="0.1" stroke-width="0.1" stroke="{stroke}" /> """

        svg +='</svg>'
        display(HTML(svg))
    
    elif organism == 'human_female':
        svg = f'<svg viewBox="0 0 {width} {height}" xmlns="http://www.w3.org/2000/svg">'
        for index, organ in enumerate(female_path_list):
            if organ['organ_name'] in data.keys() and data[organ['organ_name']] > 0:
                svg += f"""<path key="{index}" pointerEvents="all" className="{organ['organ_name']}" d="{organ['coordinates']}" transform="{organ['transformation']}" fill="{fill}" opacity="{data[organ['organ_name']]}" stroke-width="0.1" stroke="{stroke}">
                <title>{organ['organ_name'].replace('_', ' ').capitalize()}: {round(data[organ['organ_name']], 3)}</title>
                        </path>"""
            else:
                svg += f""" <path key="{index}" className="{organ['organ_name']}" d="{organ['coordinates']}" transform="{organ['transformation']}" fill="None" opacity="0.1" stroke-width="0.1" stroke="{stroke}" /> """

        svg +='</svg>'
        display(HTML(svg))


def tissueplot(data, organ_name='liver', organism='human_male', width=400, height=160, fill='#36175E', stroke='#0c2136'):
    """
    """
    if organism == 'human_male':
        path_list = male_path_list
    elif organism == 'human_female':
        path_list = female_path_list
    else:
        print("Please choose an organism from (human_male, human_female)")
        return
    try:
        svg = f'<svg viewBox="0 0 {width} {height}" xmlns="http://www.w3.org/2000/svg">'
        for index, organ in enumerate(path_list):
            if organ['organ_name'] == organ_name:
                try:
                    opacity = data[organ['organ_name']]
                except: 
                    opacity = 0.1
                svg += f"""<path key="{index}" pointerEvents="all" className="{organ['organ_name']}" d="{organ['coordinates']}" transform="{organ['transformation']}" fill="{fill}" opacity="{opacity}" stroke-width="0.1" stroke="{stroke}">
                    <title>{organ['organ_name'].replace('_', ' ').capitalize()}: {opacity, 3}</title>
                            </path>"""
                
                svg +='</svg>'
                display(HTML(svg))
        
    except Exception as e:
        return e
